import React, { Component } from 'react';

class BookList extends Component {
  render() {
    return (
      <div className="book-list">
        <ul>
          <li>1984</li>
          <li>The Phantom Toolbooth</li>
          <li>Their Eyes Were Watching God</li>
        </ul>
      </div>
    );
  }
}

export default BookList;
